CREATE OR REPLACE PROCEDURE "SP_SHRINKTABLESPACE"
(
tableSpaceName in varchar2 default 'CMEDB',
tableSizeThreshold_M in number default 5,
isClear in number default 1) 
as
    v_TableName varchar2(45);
    v_TableSizeM number;

    v_Sql varchar2(1024);

    cursor cur_TableName is 
    select table_name, (pages*8/1024-avg_row_len*num_rows/1024/1024/0.9) waste_mb from user_tables
    where pages*8/1024-avg_row_len*num_rows/1024/1024/0.9 > tableSizeThreshold_M order by waste_mb;
begin
    open cur_TableName;
    fetch cur_TableName into v_TableName, v_TableSizeM;
    while cur_TableName%found loop
        begin
            
            if (isClear = 0)then
                dbe_output.print_line(v_TableName || ' can be shrinked by ' || to_char(round(v_TableSizeM,2)) || 'M');            
            end if;
            
            if (isClear >= 1)then
            
                dbe_output.print_line(v_TableName || ' is shrinked by ' || to_char(round(v_TableSizeM,2)) || 'M');
            
                v_SQL := 'alter table ' || v_TableName || ' enable row movement';
                execute immediate v_SQL;
    
                v_SQL := 'alter table ' || v_TableName || '  shrink space';
                execute immediate v_SQL;
                
                dbe_stats.collect_table_stats(schema => tableSpaceName, name => v_TableName);
            end if;
            fetch cur_TableName into v_TableName, v_TableSizeM;
        end;
    end loop;
    close cur_TableName;
end;
/

